Procedure DropAllTHings;
var
  i,e : integer;
begin
  while (I < 6) do
  begin
    if not loggedin then break;
    if (I = 5) and (E < 8) then
    begin
      I := 0;
      E := E + 1;
    end;
    if  FindColor(x,y,65536,(570 + 39 * I), (214 + 35 * E), (609 + 39 * I), (249 + 35 * E)) then
    begin
      Mouse(x, y, 10, 10, False);
      ChooseOption(x,y,'Drop');
    end;
    if (I = 4) and (E = 7) then break;
    I := I + 1;
  end;
end;

